function Making ($text, $checked, $enabled, $loc1, $loc2, $width, $height, $autoSize, $object) {
    #Used to make the Gui in the first form
    $location                               = New-Object System.Drawing.Point($loc1, $loc2)
    $obj                                    = New-Object $object
    $obj.text                               = $text
    $obj.width                              = $width
    $obj.height                             = $height
    $obj.location                           = $location
    $obj.AutoSize                           = $autoSize
    if($obj -match "System.Windows.Forms.TextBox") {
        $obj.multiline                      = $true
    } 
    if($obj -match "System.Windows.Forms.CheckBox") {
        $obj.Checked                        = $checked
        $obj.Enabled                        = $enabled
    }
    if($obj -match "System.Windows.Forms.ComboBox") {
        $obj.DropDownStyle    = [System.Windows.Forms.ComboBoxStyle]::DropDownList
    } 
    $obj
}
function Picture ($In_Form) {
    [reflection.assembly]::LoadWithPartialName("System.Windows.Forms")
    $PictureBox                     = New-Object system.Windows.Forms.PictureBox
    $PictureBox.width               = 143
    $PictureBox.height              = 63
    $PictureBox.location            = New-Object System.Drawing.Point(25,10)
    $PictureBox.imageLocation       = "https://www.mynster-it.dk/img/Logo.png"
    $PictureBox.SizeMode            = [System.Windows.Forms.PictureBoxSizeMode]::zoom
    $In_Form.controls.add($pictureBox)
    $iconBase64                     = ''
    $iconBytes                      = [Convert]::FromBase64String($iconBase64)
    $global:stream                  = [System.IO.MemoryStream]::new($iconBytes, 0, $iconBytes.Length)
    $In_Form.Icon                   = [System.Drawing.Icon]::FromHandle(([System.Drawing.Bitmap]::new($stream).GetHIcon()))
}
Function Get-CommandResults { 
    [cmdletbinding()]
    Param($Command)
    $Result.text = (powershell -noprofile $Command | Out-String)
    if ($Extract_Results.Checked) {
        Add-Content -Path $filename "------------------------------------------------------------------"
        Add-Content -Path $filename $Command
        Add-Content -Path $filename "------------------------------------------------------------------"
        Add-Content -Path $filename (powershell -noprofile $Command | Out-String)
        Add-Content -Path $filename "__________________________________________________________________"
        Add-Content -Path $filename ""
    }
}
