function Reset_Office_License {
    If (! $(Get-ItemProperty -Path "HKCU:\Software" -Name "O365LicenseReset" -ErrorAction SilentlyContinue)) {
        $x86Office = "C:\Program Files (x86)\Microsoft Office\Office16\OSPP.VBS"
        $x64Office = "C:\Program Files\Microsoft Office\Office16\OSPP.VBS"
        if([System.IO.File]::Exists($x86Office)) {
            $OSPPScriptFile = $x86Office
        }
        if([System.IO.File]::Exists($x64Office)) {
            $OSPPScriptFile = $x64Office
        }
        if ($OSPPScriptFile) {
            $license = cscript $OSPPScriptFile /dstatus
            $keys = $license | Select-String "Last 5"
            $keys = $keys -replace 'Last 5 characters of installed product key: '
            foreach ($key in $keys) {
                cscript $OSPPScriptFile /unpkey:$key
            }
            New-ItemProperty -Path "HKCU:\Software" -Name "O365LicenseReset"
            $output = "Licenses has now been reset"
        } else {
            Write-EventLog -LogName "Application" -Source "Application Error" -EventID 1000 -EntryType Warning -Message "No O365 license was not cleared. OSPP.vbs was not found."
            $output = "No O365 license was not cleared. OSPP.vbs was not found."
        }
        $global:Result.text = $output
    }
}
function Check_Office_License {
    If (! $(Get-ItemProperty -Path "HKCU:\Software" -Name "O365LicenseReset" -ErrorAction SilentlyContinue)) {
        $x86Office = "C:\Program Files (x86)\Microsoft Office\Office16\OSPP.VBS"
        $x64Office = "C:\Program Files\Microsoft Office\Office16\OSPP.VBS"
        if([System.IO.File]::Exists($x86Office)) {
            $OSPPScriptFile = $x86Office
        }
        if([System.IO.File]::Exists($x64Office)) {
            $OSPPScriptFile = $x64Office
        }
        if ($OSPPScriptFile) {
            $license = cscript $OSPPScriptFile /dstatus
        }
    $global:Result.text = $license
    }
}
function new_mailprofile {
    $NewProfileName = get-date -Format "dd/MMMM/yyyy HH:mm"
    $TestName = Test-Path HKCU:\SOFTWARE\Microsoft\Office\16.0\Outlook\Profiles\$NewProfileName
    if($TestName -eq $true){
        $global:Result.text = "A mailprofile with the name '$NewProfileName' already exists - Please try again later"
        } else {
        New-Item 'HKCU:\SOFTWARE\Microsoft\Office\16.0\Outlook\Profiles' -Name $NewProfileName
        Set-ItemProperty 'HKCU:\SOFTWARE\Microsoft\Office\16.0\Outlook' -Name 'DefaultProfile' -Value $NewProfileName
        $global:Result.text = "The new profile '$NewProfileName' has now been created and set as default"
    }    
}
