function Uptimee {
    $boot = (Get-CimInstance -ClassName win32_operatingsystem | Select-Object LastBootUpTime ).lastbootuptime
    $now = Get-Date
    $time = New-TimeSpan -start $boot -end $now | Select-Object Days, Hours, Minutes, Seconds
    $Result.text = $time
}
function Refresh_Windows_Update {
    Stop-Service -Name wuauserv; Set-Service -Name wuauserv -Status stopped -StartupType Disabled
    Remove-Item –path C:\Windows\SoftwareDistribution –recurse
    Set-Service -Name wuauserv -Status stopped -StartupType Manual; Start-Service -Name wuauserv
}
